densityplot(~size, sizes, groups = package, auto.key = list(columns = 3), 
    plot.points = FALSE, panel = function(x, ..., subscripts) {
        panel.densityplot(x, ..., subscripts = subscripts)
        d = sizes[subscripts, ]
        i = d$size > threshold
        if (any(i)) {
            by(d[i, ], d[i, "package"], function(tmp) {
                tmp = tmp[order(tmp$size), ]
                y = seq(0.15, 1, length = nrow(tmp))
                lsegments(tmp$size, rep(0, length(y)), tmp$size, 
                  y, col = "lightgray", lty = 2)
                panel.text(tmp$size, y, tmp$name)
            })
        }
    })
